const MongoClient = require("mongoose");

function fetchFromDataBase() {
  const URI = "mongodb://127.0.0.1:27017/restro";
  const client = new MongoClient(URI);
  const collection = client.db("restro").collection("restros");
  if (collection == []) {
    console.log("Database Is Empty");
  } else {
    collection.find({}).toArray((err, documents) => {
      if (err) {
        console.error("Error fetching data:", err);
        return;
      }
      console.log("Fetched data:", documents);
    });
  }
  client.close();
}

const KitchenService = () => {
  const greeting = "Hello, jsx";
  return (
    <div>
      <h1>{greeting}</h1>
      <button onClick={fetchFromDataBase()}>ViewOrders</button>
    </div>
  );
};
export default KitchenService;
